import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
var Sql_select = require("../sql/Sql_select.js");

const Create = (IProps: any) => {
  const navigate = useNavigate();

  const navigateToBack = () => {
    navigate("/");
  };

  const pre_id_Check = () => {
    if (state.id === "") {
      alert("중복 확인을 해주세요");
    }
  };

  function handleChange(e: any) {
    setState({
      ...state,
      [e.target.name]: e.target.value,
    });
  }

  const [state, setState] = useState({
    id: "",
    pw: "",
    name: "",
    phone: "",
    SSN: "",
    email: "",
  });

  return (
    <div className="box">
      <form method="post" className="create_form">
        <fieldset className="inner_form">
          <legend className="title">회원가입</legend>
          <div className="id_title">
            <span className="subtitle1">아이디 : </span>
            <div className="id_section">
              <input
                type="text"
                name="id"
                className="id"
                value={state.id}
                placeholder="아이디를 입력해주세요"
                onChange={handleChange}
              ></input>
              <button className="id_check_btn" onClick={pre_id_Check}>
                중복
              </button>
            </div>
          </div>
          <div>
            <span className="subtitle">비밀번호 : </span>
            <input
              type="password"
              name="pw"
              className="pw"
              value={state.pw}
              placeholder="비밀번호를 입력해주세요"
              onChange={handleChange}
            ></input>
          </div>
          <div>
            <span className="subtitle1">이름 : </span>
            <input
              type="text"
              name="name"
              className="name"
              value={state.name}
              placeholder="이름을 입력해주세요"
              onChange={handleChange}
            ></input>
          </div>
          <div>
            <span className="subtitle">전화번호 : </span>
            <input
              type="text"
              name="phone"
              className="phone"
              value={state.phone}
              placeholder="전화번호를 입력해주세요"
              onChange={handleChange}
            ></input>
          </div>
          <div>
            <span className="subtitle">주민번호 : </span>
            <input
              type="text"
              name="SSN"
              className="SSN"
              value={state.SSN}
              placeholder="주민번호를 입력해주세요"
            ></input>
          </div>
          <div>
            <span className="subtitle">e-mail : </span>
            <input
              type="text"
              name="email"
              className="email"
              value={state.email}
              placeholder="이메일을 입력해주세요"
            ></input>
          </div>
        </fieldset>
        <button className="create_btn" onClick={navigateToBack}>
          확인
        </button>
      </form>
    </div>
  );
};

export default Create;
